# Wallhaven 壁纸自动更换程序
# 支持托盘菜单、定时/手动切换、参数配置、自动清理旧壁纸
# 适用于 Windows 11，开源友好，依赖 pystray、Pillow、requests

import os
import sys
import time
import json
import requests
import ctypes
import random
import logging
import threading
import pystray
import base64
from io import BytesIO
from urllib.parse import urlencode
from datetime import datetime
from PIL import Image, ImageDraw
import tkinter as tk
from tkinter import messagebox
import shutil

# 获取程序真实所在目录（支持pyinstaller打包和源码运行）
if getattr(sys, 'frozen', False):
    BASE_DIR = os.path.dirname(sys.executable)
else:
    BASE_DIR = os.path.dirname(os.path.abspath(__file__))

# 配置与日志文件路径
CONFIG_PATH = os.path.join(BASE_DIR, 'config.json')
LOG_PATH = os.path.join(BASE_DIR, 'wallpaper.log')

# Windows 设置壁纸的 SPI 常量
SPI_SETDESKWALLPAPER = 20

def setup_logger():
    """初始化日志系统，输出到文件和控制台，级别为DEBUG"""
    logging.basicConfig(
        level=logging.INFO,  # 默认INFO，DEBUG可通过配置切换
        format='%(asctime)s %(levelname)s: %(message)s',
        handlers=[
            logging.FileHandler(LOG_PATH, encoding='utf-8'),
            logging.StreamHandler(sys.stdout)
        ]
    )


def load_config():
    """加载配置文件，若失败则返回默认配置"""
    try:
        with open(CONFIG_PATH, 'r', encoding='utf-8') as f:
            return json.load(f)
    except Exception as e:
        logging.error(f"加载配置文件失败: {e}")
        return {
            "api_url": "https://wallhaven.cc/api/v1/search",
            "api_key": "",
            "params": {
                "q": "",
                "categories": "111",
                "purity": "111",
                "sorting": "favorites",
                "topRange": "",
                "atleast": "3840x2160"
            },
            "interval_minutes": 10
        }


def get_wallpaper_url(config, downloaded_set=None):
    """调用 Wallhaven API 获取壁纸下载地址，优先未下载过的"""
    api_url = config['api_url']
    params = config['params']
    headers = {}
    api_key = config.get('api_key')
    if api_key:
        headers['X-API-Key'] = api_key
    url = f"{api_url}?{urlencode(params)}"
    logging.debug(f"API请求: {url} headers={headers}")
    try:
        resp = requests.get(url, headers=headers, timeout=15)
        resp.raise_for_status()
        data = resp.json()
    except Exception as e:
        raise Exception(f"API请求失败: {e}")
    if not data.get('data'):
        raise Exception('No wallpapers found!')
    tmp_dir = os.path.join(BASE_DIR, 'tmp')
    os.makedirs(tmp_dir, exist_ok=True)
    if downloaded_set is None:
        downloaded_set = set(os.listdir(tmp_dir))
    # 优先选择未下载过的壁纸
    candidates = [w for w in data['data'] if os.path.basename(w['path']) not in downloaded_set]
    wallpaper = random.choice(candidates) if candidates else random.choice(data['data'])
    return wallpaper['path']


def download_wallpaper(url, tmp_dir):
    """下载壁纸到 tmp 目录，已存在则跳过"""
    os.makedirs(tmp_dir, exist_ok=True)
    filename = os.path.basename(url)
    path = os.path.join(tmp_dir, filename)
    if os.path.exists(path):
        logging.info(f"壁纸已存在: {path}")
        return path
    try:
        logging.debug(f"开始下载壁纸: {url}")
        with requests.get(url, stream=True, timeout=30) as resp:
            resp.raise_for_status()
            with open(path, 'wb') as f:
                shutil.copyfileobj(resp.raw, f)
        logging.info(f"壁纸已下载: {path}")
        return path
    except Exception as e:
        logging.error(f"下载壁纸失败: {url} {e}")
        if os.path.exists(path):
            os.remove(path)
        raise


def set_wallpaper(path):
    """设置 Windows 桌面壁纸"""
    try:
        ctypes.windll.user32.SystemParametersInfoW(SPI_SETDESKWALLPAPER, 0, path, 3)
        logging.info(f"壁纸已设置: {path}")
    except Exception as e:
        logging.error(f"设置壁纸失败: {e}")


def clean_old_wallpapers(tmp_dir, days=7):
    """自动清理 tmp 目录下超过 days 天的壁纸文件"""
    now = time.time()
    expire = days * 86400
    for fname in os.listdir(tmp_dir):
        fpath = os.path.join(tmp_dir, fname)
        if os.path.isfile(fpath):
            try:
                if now - os.path.getmtime(fpath) > expire:
                    os.remove(fpath)
                    logging.info(f"已清理过期壁纸: {fpath}")
            except Exception as e:
                logging.warning(f"清理壁纸时出错: {fpath} {e}")


def ensure_default_files():
    """首次运行时自动生成默认config.json、log和tmp目录"""
    default_config = {
        "api_url": "https://wallhaven.cc/api/v1/search",
        "api_key": "",
        "params": {
            "q": "",
            "categories": "111",
            "purity": "111",
            "sorting": "favorites",
            "topRange": "",
            "atleast": "3840x2160"
        },
        "interval_minutes": 10
    }
    if not os.path.exists(CONFIG_PATH):
        with open(CONFIG_PATH, 'w', encoding='utf-8') as f:
            json.dump(default_config, f, ensure_ascii=False, indent=2)
    if not os.path.exists(LOG_PATH):
        open(LOG_PATH, 'a', encoding='utf-8').close()
    tmp_dir = os.path.join(BASE_DIR, 'tmp')
    os.makedirs(tmp_dir, exist_ok=True)

# 内嵌 base64 图标
ICON_B64 = ''''''

class WallpaperTrayApp:
    """主程序类，负责托盘、定时、菜单、配置等"""
    def __init__(self):
        self.config = load_config()
        self.interval = max(60, self.config.get('interval_minutes', 10) * 60)  # 最小1分钟
        self.tmp_dir = os.path.join(BASE_DIR, 'tmp')
        self.running = True
        self.timer_enabled = True
        self.thread = threading.Thread(target=self.run_loop, daemon=True)
        self.icon = self.create_tray_icon()

    def create_tray_icon(self):
        """创建托盘图标和菜单，优先使用内嵌 base64 图标"""
        image = None
        try:
            icon_bytes = base64.b64decode(ICON_B64)
            image = Image.open(BytesIO(icon_bytes))
        except Exception as e:
            logging.warning(f"加载内嵌 base64 图标失败: {e}")
        if image is None:
            # 兜底：生成一个简单的蓝色图标
            image = Image.new('RGB', (64, 64), color=(0, 128, 255))
            d = ImageDraw.Draw(image)
            d.rectangle([16, 16, 48, 48], fill=(255, 255, 255))
        return pystray.Icon('WallhavenWallpaper', image, 'Wallhaven壁纸', self.create_menu())

    def create_menu(self):
        """创建托盘右键菜单"""
        return pystray.Menu(
            pystray.MenuItem('立即切换', self.menu_switch_now),
            pystray.MenuItem(
                '定时切换', self.menu_toggle_timer,
                checked=lambda item: self.timer_enabled
            ),
            pystray.MenuItem('配置参数', self.menu_config),
            pystray.MenuItem('退出程序', self.menu_exit)
        )

    def menu_config(self, icon, item):
        """托盘菜单：配置参数，弹出记事本编辑 config.json"""
        self.show_config_window()

    def show_config_window(self):
        """用记事本打开 config.json，编辑后弹窗提示并刷新配置"""
        def notify_and_reload():
            root = tk.Tk()
            root.withdraw()
            messagebox.showinfo('提示', '已打开config.json，请手动编辑并保存。\n修改后点击“确定”刷新配置。')
            root.destroy()
            try:
                self.config = load_config()
                self.interval = max(60, self.config.get('interval_minutes', 10) * 60)
                logging.info('配置已刷新: %s', self.config)
            except Exception as e:
                logging.error('配置刷新失败', exc_info=True)
        try:
            os.startfile(CONFIG_PATH)
            logging.info('已打开config.json，请手动编辑并保存。')
            threading.Thread(target=notify_and_reload, daemon=True).start()
        except Exception as e:
            def show_error():
                root = tk.Tk()
                root.withdraw()
                messagebox.showerror('错误', f'无法打开配置文件: {e}')
                root.destroy()
            logging.error('打开配置文件失败', exc_info=True)
            threading.Thread(target=show_error, daemon=True).start()

    def menu_switch_now(self, icon, item):
        """托盘菜单：立即切换壁纸"""
        self.switch_wallpaper()

    def menu_toggle_timer(self, icon, item):
        """托盘菜单：定时切换开关"""
        self.timer_enabled = not self.timer_enabled
        logging.info(f"定时切换 {'已开启' if self.timer_enabled else '已关闭'}")

    def menu_exit(self, icon, item):
        """托盘菜单：退出程序"""
        self.running = False
        icon.stop()
        logging.info("程序已退出。")
        os._exit(0)

    def switch_wallpaper(self):
        """切换壁纸并自动清理旧壁纸"""
        clean_old_wallpapers(self.tmp_dir, days=7)
        try:
            downloaded_set = set(os.listdir(self.tmp_dir))
            url = get_wallpaper_url(self.config, downloaded_set)
            img_path = download_wallpaper(url, self.tmp_dir)
            set_wallpaper(img_path)
        except Exception as e:
            logging.error(f"更换壁纸失败: {e}")

    def run_loop(self):
        """定时切换壁纸的后台线程"""
        while self.running:
            if self.timer_enabled:
                self.switch_wallpaper()
            slept = 0
            while self.running and self.timer_enabled and slept < int(self.interval):
                time.sleep(1)
                slept += 1
            while self.running and not self.timer_enabled:
                time.sleep(1)

    def run(self):
        """启动托盘和定时线程"""
        self.thread.start()
        logging.info('托盘图标已启动，等待用户操作...')
        self.icon.run()


def main():
    ensure_default_files()
    setup_logger()
    logging.info("Wallhaven 壁纸自动更换程序启动（托盘模式）。")
    app = WallpaperTrayApp()
    app.run()

if __name__ == '__main__':
    main()
